import React from 'react';
import Filter from "./Filter"

const Filters = (props) => {

  console.log(props.filters.map(filter => console.log(filter)))

return (
    <div>
    <h2>FILTERS</h2>
    {props.filters.map((filter) => (
      <>
      {filter.type != 'slider' ?
          (
          <Filter
            label={filter.label}
            field={filter.field}
            values={filter.values}
          />) : (
            <p>slider</p>
            )}
      </>
        ))}
    </div>
)

}

export default Filters;
